import React from "react";
import Title from "./styles/song/title";
import ArtistStyles from "./styles/song/songStyles";
import PleaseSignIn from "./PleaseSignIn";
// import Composer from "./styles/song/composer";
import Link from "next/link";
// import DeleteSong from "./DeleteSong";

const Artist = ({ artist }) => (
  <ArtistStyles>
    <Title>
      <Link href={{ pathname: "/artist", query: { id: artist.id } }}>
        <a>{artist.name}</a>
      </Link>
    </Title>
    <PleaseSignIn>
      <div className="buttonList">
        <Link href={{ pathname: "update", query: { id: artist.id } }}>
          <a>Edit Artist</a>
        </Link>
      </div>
    </PleaseSignIn>
  </ArtistStyles>
);

export default Artist;
